import React, { Component } from 'react'
import axios from 'axios'

class TodoList extends Component {
    state = {
        todos: []
    }

    componentDidMount() {
        axios.get('http://localhost:5000')
            .then(res => {
                this.setState({
                    todos: res.data
                })
            })
            .catch(error => console.log(`Error fetch API ${error}`))
    }
    render() {
        let { todos } = this.state
        return (
            <div className="container">
                <p>Welcome to Todo List Component</p>
                {/* <ul>
                    {todos.map(todo => (
                        <li key={todo._id}>
                            <p>{todo.discription}</p>
                            <p>{todo.responsible}</p>
                            <p>{todo.priority}</p>
                            <p>{todo.isCompleted}</p>
                        </li>
                    ))}
                </ul> */}
                {todos.map(todo => (
                    <div class="card border-dark mb-3" key={todo._id} >
                        <div class="card-header">Todo</div>
                        <div class="card-body text-dark">
                            <h5 class="card-title">Title: {todo.discription}</h5>
                            <p class="card-text">Info: {todo.responsible}</p>
                            <p class="card-text">Priority {todo.priority}</p>
                            <p class="card-text">isCompleted{todo.isCompleted}</p>

                        </div>
                    </div>
                ))}
            </div>
        )
    }
}

export default TodoList
